import React from "react";
import styled from "styled-components";

export default function Listrender(props) {
  return (
    <>
      {props.list.map((list) => {
        return (
          <MainContainer>
            <div>
              {list.title} ({list.date.toLocaleString()})
            </div>
          </MainContainer>
        );
      })}
    </>
  );
}

const MainContainer = styled.div`
  border: 2px solid green;
`;
